import './index.css';
import { useNavigate } from 'react-router-dom';
import { useState } from 'react';
import React, { useEffect } from 'react';
import axios from 'axios';
import Modal from 'react-modal';
import { Link } from 'react-router-dom';
import Create from './create';
import Back from './Back.png'
import Main from './main';
import { useParams } from 'react-router-dom';






function CurseDetails() {





    var userName = localStorage.getItem('userName');
    const token = localStorage.getItem('token');
    var userName = localStorage.getItem('userName');
    const navigate = useNavigate();
    const [rates, setRates] = useState([]);
    const { courseUID } = useParams();
    const [students, setStudents] = useState([]);

    useEffect(() => {
      getCourseDetails();
    }, []);

    const [errorModal, setErrorModal] = useState(
        {
            isOpen: false,
            errorText: ''
        });

        const [newCource, setNewCource] = useState({
            Name: '',
            ShortID: uniqueId(),
            Price: 0,
            Duration: '',
            SourceLink: "",
            SourceLink: "",
            CreatedAt: "",
            Description: '',
            detailsButton: true, // флаг указывает на наличие кнопки "Подробнее"
          });

          function uniqueId() {
            const letters = 'abcdefghijklmnopqrstuvwxyz'; // набор букв, из которого будет производиться выбор
            let id = '';
            let length = 5;

            for (let i = 0; i < length; i++) {
              const randomIndex = Math.floor(Math.random() * letters.length);
              const randomLetter = letters.charAt(randomIndex);
              id += randomLetter;
            }

            return id;
          }

    function handleGoBack() {
        navigate('/main'); // Переход на страницу "main"
      }

      function handleClick(event) {
        navigate('/');
    }

    // useEffect(() => {
    //     getRates();
    // }, []);

    async function getCourseDetails() {
        console.log(courseUID);

        try {
            const response = await fetch(`https://fp-services.ru/installment/courses/get?course_uid=${courseUID}`, {
                method: "GET",
                headers: {
                    "Authorization": `Bearer ${token}`
                },
                body: JSON.stringify(newCource)
            });

            if (response.ok) {
                const data = await response.json();
                const courseData = data.Data;
                const courseStudents = courseData.Students;
                setStudents(courseStudents);

                console.log(data);

                  setRates(data.Data);

            } else {
                const errorData = await response.json();
                console.error('CurseDetails error', errorData);

                setErrorModal(
                    {
                        isOpen: true,
                        errorText: errorData
                    }

                )
            }
        } catch (error) {
            console.error('Ошибка:', error);
        }

    }

    return (
        <div className='main'>
             {/* Шапка сайта */}
             <div className='header'>
                <div className='header-title'>
                    <div className='logo'></div>
                    <h3 className='header-text'>SHOOKRU EDUCATION</h3>
                    <button className='button-back' onClick={handleGoBack}> Назад</button>
                </div>

                <div className='header-inner'>
                    <h5 className='Name'>{userName}</h5>
                    <button className='header-button' type="button" onClick={handleClick}>Выйти</button>
                </div>
            </div>

            <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Date Start</th>
            <th>Sum Need</th>
            <th>Is Enrolled</th>
            <th>Is Cancelled</th>
          </tr>
        </thead>
        <tbody>
          {students.map((student) => (
            <tr key={student.StudentUID}>
              <td>{student.Name}</td>
              <td>{student.DateStart}</td>
              <td>{student.SumNeed}</td>
              <td>{student.IsEnrolled ? 'Yes' : 'No'}</td>
              <td>{student.IsCancelled ? 'Yes' : 'No'}</td>
            </tr>
          ))}
        </tbody>
      </table>

        </div>
        );
}

export default CurseDetails;
